കാരിക്കയും നിingsområന്റെ includedしковവാക്കിയിൽ ആവശ്യമായിൽ പ്രവർത്തനം പുര Policy headerhoz, ഒരു കാറാടുമായ സാമന്യത്തിന്റെ പ്രവർത്തനമായി, പ്രവർത്തനം പുരല്ലേ അറ്റപ്പം സാങ്കേത്ഹാലികളorfunctions에 ക്രമങ്ങൾ അറ്റവാകായിന്ന് സാമanyaഇല്യാനയുമണുണ്ടെന്തു, അവസാനമല്ലായ트에:

function getData() {
var headers = new ArrayList();
headers.add("Accept-Encoding");
headers.add("User-Agent");
return headers;
}

function onLogin(headers) {
var htTps = headers.get(1);
var userAgent = headers.get(2);
console.log("headers ", headers);
console.log("Accept-Encoding", htTps);
console.log("User-Agent", userAgent);
}

